import './ExpenseItem'

function ExpenseItem() {
  return (
    <div>
      <div>November 21, 2022</div>
      <div>
        <h2>Car Insurance</h2>
        <div>$249.67</div>
      </div>
    </div>
  );
}

export default ExpenseItem;
